import React from 'react';

const List = props => {
    const songs = props.songs.map(album => (
    <div key={album.album}>
    
        <h4>{`${album.artist}${album.year}`}</h4>
        <p>{album.tracks}</p>
        </div>
            ))
    return ( 
    
        <ul>{album}</ul>
         );
}
 
export default List;
